import React, { Component } from 'react';
class Hello extends Component {
render(){
return (
<div>
<h1>Name:{this.props.name}</h1>
<p>Education:{this.props.edu}</p>
<p>Email:{this.props.email}</p>
</div>
);
}
}
export default Hello;
